import React from "react";

export const Card = ({ children, className = "" }) => {
    return (
      <div 
        className={`
          bg-white 
          border 
          border-gray-200 
          rounded-lg 
          overflow-hidden 
          transition-shadow 
          duration-300 
          hover:shadow-lg 
          ${className}
        `}
      >
        {children}
      </div>
    );
  };
